DROP TABLE IF EXISTS gdm_gis_member CASCADE;

CREATE TABLE gdm_gis_member (
    id character varying(50),
    title character varying(100) NOT NULL,
    police_type character varying(50) NOT NULL,
    job_type character varying(50) NOT NULL,
    org_id character varying(500) NOT NULL,
    duty_status character varying(50) NOT NULL DEFAULT 1,
    sub_id character varying(50) NOT NULL,
    sub_type character varying(50) NOT NULL,
    operator character varying(50) NOT NULL,
    valid numeric(1,0) DEFAULT 1,
    create_time bigint NOT NULL,
    update_time bigint NOT NULL,
    keyword character varying(255) NOT NULL,
    org_spatial character varying(255) NOT NULL,
    rule_status character varying(50) NOT NULL,
    duty_status_label character varying(50) NOT NULL
);


CREATE INDEX ds_gis_member_duty_status_idx ON gdm.gdm_gis_member USING btree (duty_status);
CREATE INDEX ds_gis_member_org_id_idx ON gdm.gdm_gis_member USING btree (org_id);
CREATE UNIQUE INDEX pk_ds_gis_member ON gdm.gdm_gis_member USING btree (id);

COMMENT ON COLUMN gdm_gis_member.id IS 'id';
COMMENT ON COLUMN gdm_gis_member.title IS '显示名称';
COMMENT ON COLUMN gdm_gis_member.police_type IS '警种类别';
COMMENT ON COLUMN gdm_gis_member.job_type IS '岗位分类';
COMMENT ON COLUMN gdm_gis_member.org_id IS '所属单位id';
COMMENT ON COLUMN gdm_gis_member.duty_status IS '勤务状态';
COMMENT ON COLUMN gdm_gis_member.sub_id IS '子类ID';
COMMENT ON COLUMN gdm_gis_member.sub_type IS '子类类型（1-警车，2-警员）';
COMMENT ON COLUMN gdm_gis_member.operator IS '操作用户';
COMMENT ON COLUMN gdm_gis_member.valid IS '有效性,0-无效,1-有效';
COMMENT ON COLUMN gdm_gis_member.create_time IS '创建时间';
COMMENT ON COLUMN gdm_gis_member.update_time IS '更新时间';
COMMENT ON COLUMN gdm_gis_member.keyword IS '关键字集';
COMMENT ON COLUMN gdm_gis_member.org_spatial IS 'org_spatial';
COMMENT ON COLUMN gdm_gis_member.rule_status IS '违规状态';
COMMENT ON COLUMN gdm_gis_member.duty_status_label IS '出警类型';

